bayonet, the other the size of a cavalry saber. 

Despite her wounds, she started a charge towards Tyrael, despite he was in 
the air. &quot;Come to face a REAL Decepticon, Tyrael!&quot;

Pausing, &quot;Alpha Trion does NOT govern MY fate!&quot; 

